// ProfilePage.js
import React from 'react';

function ProfilePage({ user }) {
    if (!user) {
        return <p>Loading user profile...</p>;
    }

    const name = user.idTokenClaims?.name || user.username || "User";
    const email = user.idTokenClaims?.email || user.idTokenClaims?.emails?.[0] || "No email provided";

    return (
        <div>
            <h1>Welcome, {name}!</h1>
            <p>Email: {email}</p>
        </div>
    );
}

export default ProfilePage;
